import Sidebar from "./components/sidebar/Sidebar";
import Topbar from "./components/topbar/Topbar";
import "./App.css";
import Home from "./pages/home/Home";
import Login from "./pages/login/Login";

import { BrowserRouter as Router, Route ,Routes } from "react-router-dom";
import { Navigate } from "react-router-dom";
import { useContext } from "react";

import TeacherList from "./pages/teacherList/TeacherList";
import Teacher from "./pages/teacher/Teacher";
import PidrozdilList from "./pages/pidrozdilList/PidrozdilList";
import Pidrozdil from "./pages/pidrozdil/Pidrozdil";
import NewPidrozdil from "./pages/newPidrozdil/NewPidrozdil";
import NewTeacher from "./pages/newTeacher/NewTeacher";
import Question from "./pages/question/Question"
import QuestionList from "./pages/questionList/QuestionList"
import Group from "./pages/group/Group";
import GroupList from "./pages/groupList/GroupList";
import Teacherrating from "./pages/teacherrating/Teacherrating";
import { AuthContext } from "./context/AuthContext";

function App() {
  const ProtectedRoute = ({ children }) => {
    const { user } = useContext(AuthContext);

    if (!user) {
      return <Navigate to="/login" />;
    }

    return children;
  };
  return (
    <Router>
      <Topbar />
      <div className="container">
        <Sidebar />
        <Routes>
          <Route exact path="/teacherrating">
            <Teacherrating />
          </Route>
          <Route path="login" element={<Login />} />
            <Route
              index
              element={
                <ProtectedRoute>
                  <Home />
                </ProtectedRoute>
              }
            />
          <Route exact path="/group" element={<Login />}>
            <Group />
          </Route>
          <Route exact path="/groups" element={<Login />}>
            <GroupList />
          </Route>
          <Route path="/teachers" element={<Login />}>
            <TeacherList />
          </Route>
          <Route path="/teacher/:teacherId" element={<Login />}>
            <Teacher />

          </Route>

          <Route path="/newTeacher" element={<Login />}>
            <NewTeacher />
          </Route>
          <Route path="/pidrozdils" element={<Login />}>
            <PidrozdilList />
          </Route>
          <Route path="/pidrozdil/:pidrozdilId" element={<Login />}>
            <Pidrozdil />
          </Route>
          <Route path="/newpidrozdil" element={<Login />}>
            <NewPidrozdil />
          </Route>
          <Route path="/Question" element={<Login />}>
            <Question />
          </Route>
          <Route path="/Questions" element={<Login />}>
            <QuestionList />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
